import React from "react";
import {
  Exchange,
  Features,
  Footer,
  Hero,
  Navbar,
  Portfolio,
  WalletDashboard,
} from "./Navbar";

const HomePage = () => {
  return (
    <div>
      <Hero />
      <Features />
      <WalletDashboard />
      <Exchange />
      <Portfolio />
    </div>
  );
};

export default HomePage;
